INSERT INTO `performancenotes` VALUES (3,9,'A','[\n    {\n        \"message\": \"The mean depth of compressions is above the recommended range, indicating a need for improvement in compression depth control.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The mean frequency of compressions is considerably higher than recommended, with high variability, showing a need for better frequency regulation.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The standard deviation in compression depth is high, indicating inconsistency in compression application.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Overall performance score is low, suggesting an opportunity for targeted feedback and additional practice.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),(4,11,'A','[\n    {\n        \"message\": \"The average compression depth of 96.44 mm falls within the recommended range for effective CPR.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"There is high variability in compression depth with a standard deviation of 12.23 mm.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The mean compression frequency of 91.64 compressions per minute suggests pacing is slightly too fast.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Low variability in compression frequency indicates consistent pacing with a standard deviation of 12.84 compressions per minute.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"Overall performance score of 32.96 indicates there is significant room for improvement.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),(5,12,'A','[\n    {\n        \"message\": \"The average compression depth of 37.10 mm is below the recommended range of 50-60 mm for effective CPR.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The average compression frequency of 92.39 compressions per minute is slightly below the recommended range of 100-120 compressions per minute.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Consistency in compression depth is lacking with a high standard deviation of 8.83 mm, indicating significant variation in the compression depth.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The overall performance score of 38.19 suggests there is substantial room for improvement in CPR execution.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),(6,1,'H','bir daha aferim'),(8,18,'H','ehe'),(9,7,'H','Tekniğin iyi ama geliştirmen lazım.'),(10,17,'H','30 sn yapmış beğenmedim'),(11,12,'H','5 sn çok olmuş ya'),(12,19,'A','[\n    {\n        \"message\": \"The average compression depth of 12.34 mm is significantly below the ideal range, indicating a major area for improvement.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The average compression frequency of 56.78 compressions per minute is far below the ideal, suggesting the need for increased pace.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Low deviations in both compression depth and frequency suggest good consistency in performance.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"With 91.25% as an overall performance score, despite shortcomings, the session demonstrated a high level of competence.\",\n        \"sentiment\": \"Positive\"\n    }\n]');
